export default function Index() {
  return (
    <div>

      <div className="home-menu">

        <div className="main-box">
          <h2>Destress</h2>
          <p>Relax with meditation</p>
        </div>
        <div className="main-box">
          <h2>Organise</h2>
          <p>Schedule your time</p>
        </div>
        <div className="main-box">
          <h2>Reach Out</h2>
          <p>Find help</p>
        </div>
        <div className="main-box">
          <h2>Choco Project</h2>
          <p>Join the community</p>
        </div>

      </div>

    <style jsx>{`

      .home-menu {
        overflow: hidden;
        margin: 0 auto;
        width: 100%;
      }

      .main-box { 
        background: #FBF3E8; 
        width: 90vw;
        margin: 0 auto;
        margin-top: 3vh;
        margin-bottom: 3vh;
        height: 20vh;
        display: block;
        overflow: hidden;
        padding: 10vw;
      }

      h2 { 
        font-family: Raleway; 
        font-weight: bold; 
        font-size: 300%; 
        color: #4488F4; 
      }

      p {
        font-family: Montserrat;
        font-size: 150%;
      }

    `}</style>

    </div>
  );
}
